import React from 'react';
import {HeaderTag} from './style'
// import Logo from '../../assets/docred_logo.png'

const Header = () => {
  return (
    <HeaderTag>
      <figure>
        <img src="./docred.png"/>
      </figure>
      <div>
        <input type="text" />
        <input type="submit" />
      </div>
      <nav>
        <ul>
          <li><a>inicio</a></li>
        </ul>  
      <div>
        <ul>
          <li><button></button></li>
          <li><button></button></li>
          <li><button></button></li>
        </ul>
      </div>
      </nav>
    </HeaderTag>
  );
};

export default Header;
